public class InnerAnalysisAnalysisDefinitionFactory(Action<Humidifier.QuickSight.AnalysisTypes.AnalysisDefinition> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.AnalysisTypes.AnalysisDefinition>
{

    internal InnerAnalysisAssetOptionsFactory OptionsFactory { get; set; }

    internal InnerAnalysisQueryExecutionOptionsFactory QueryExecutionOptionsFactory { get; set; }

    internal InnerAnalysisAnalysisDefaultsFactory AnalysisDefaultsFactory { get; set; }

    protected override Humidifier.QuickSight.AnalysisTypes.AnalysisDefinition Create()
    {
        var analysisDefinitionResult = CreateAnalysisDefinition();
        factoryAction?.Invoke(analysisDefinitionResult);

        return analysisDefinitionResult;
    }

    private Humidifier.QuickSight.AnalysisTypes.AnalysisDefinition CreateAnalysisDefinition()
    {
        var analysisDefinitionResult = new Humidifier.QuickSight.AnalysisTypes.AnalysisDefinition();

        return analysisDefinitionResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.AnalysisTypes.AnalysisDefinition result)
    {
        base.CreateChildren(result);

        result.Options ??= OptionsFactory?.Build();
        result.QueryExecutionOptions ??= QueryExecutionOptionsFactory?.Build();
        result.AnalysisDefaults ??= AnalysisDefaultsFactory?.Build();
    }

} // End Of Class

